import{_ as e,c as t,o as a,a as r}from"./app.bce571d7.js";const b=JSON.parse('{"title":"Treaties","description":"","frontmatter":{},"headers":[{"level":2,"title":"~~Ascension of Southshire~~","slug":"ascension-of-southshire"},{"level":2,"title":"Charter for the Southern Area Treaty Organisation","slug":"charter-for-the-southern-area-treaty-organisation"},{"level":2,"title":"Treaty of Okatu","slug":"treaty-of-okatu"},{"level":2,"title":"Treaty of Odresh","slug":"treaty-of-odresh"},{"level":2,"title":"~~Merger with Vinland~~","slug":"merger-with-vinland"},{"level":2,"title":"Condemning Obby Bombing","slug":"condemning-obby-bombing"},{"level":2,"title":"Joining the UDF","slug":"joining-the-udf"},{"level":2,"title":"Forum for International Diplomacy","slug":"forum-for-international-diplomacy"},{"level":2,"title":"~~Treaty of Terestai~~","slug":"treaty-of-terestai"}],"relativePath":"constitution/treaties.md","lastUpdated":1660783698000}'),o={name:"constitution/treaties.md"},i=r('<h1 id="treaties" tabindex="-1">Treaties <a class="header-anchor" href="#treaties" aria-hidden="true">#</a></h1><p>Here shown are the treaties past and present (treaties no longer in effect are crossed out). You can find the archive of all treaties <a href="https://civstorage.github.io/yoahtl/" target="_blank" rel="noopener noreferrer">here</a>.</p><nav class="table-of-contents"><ul><li><a href="#ascension-of-southshire">Ascension of Southshire</a></li><li><a href="#charter-for-the-southern-area-treaty-organisation">Charter for the Southern Area Treaty Organisation</a></li><li><a href="#treaty-of-okatu">Treaty of Okatu</a></li><li><a href="#treaty-of-odresh">Treaty of Odresh</a></li><li><a href="#merger-with-vinland">Merger with Vinland</a></li><li><a href="#condemning-obby-bombing">Condemning Obby Bombing</a></li><li><a href="#joining-the-udf">Joining the UDF</a></li><li><a href="#forum-for-international-diplomacy">Forum for International Diplomacy</a></li><li><a href="#treaty-of-terestai">Treaty of Terestai</a></li></ul></nav><h2 id="ascension-of-southshire" tabindex="-1"><s>Ascension of Southshire</s> <a class="header-anchor" href="#ascension-of-southshire" aria-hidden="true">#</a></h2><p>Yoahtl signed the <a href="https://civstorage.github.io/yoahtl/southshire-ascension/" target="_blank" rel="noopener noreferrer">Ascension of Southshire</a> treaty allowing Southshire to join as an autonomous town.</p><ul><li>Signed 14th January 2018</li><li>Voided 25th August 2018</li></ul><h2 id="charter-for-the-southern-area-treaty-organisation" tabindex="-1">Charter for the Southern Area Treaty Organisation <a class="header-anchor" href="#charter-for-the-southern-area-treaty-organisation" aria-hidden="true">#</a></h2><p>Yoahtl agreed to the terms of the <a href="https://civstorage.github.io/yoahtl/southern-area-treaty-organisation/" target="_blank" rel="noopener noreferrer">Charter for the Southern Area Treaty Organisation</a>.</p><ul><li>Signed Spring 2018 (the exact date when this was signed is unclear, and there seems to be no enthusiasm from those in the know to check)</li></ul><h2 id="treaty-of-okatu" tabindex="-1">Treaty of Okatu <a class="header-anchor" href="#treaty-of-okatu" aria-hidden="true">#</a></h2><p>Yoahtl signed the <a href="https://civstorage.github.io/yoahtl/okashima-ascension/" target="_blank" rel="noopener noreferrer">Treaty of Okatu</a> (<a href="https://civstorage.github.io/yoahtl/okashima-ascension/#accessible" target="_blank" rel="noopener noreferrer">accessible version</a>) allowing the Kingdom of Okashima to join as a non-autonomous town.</p><ul><li>Signed 24th August 2019</li><li>The arrangements of the treaty were changed with <a href="https://www.reddit.com/r/CivYoahtl/wiki/laws#wiki_.287rnh.29_the_great_coup_of_okashima=" target="_blank" rel="noopener noreferrer">The Great Coup of Okashima</a>.</li></ul><h2 id="treaty-of-odresh" tabindex="-1">Treaty of Odresh <a class="header-anchor" href="#treaty-of-odresh" aria-hidden="true">#</a></h2><p>Yoahtl signed the <a href="https://civstorage.github.io/yoahtl/odresh-ascension/" target="_blank" rel="noopener noreferrer">Treaty of Odresh</a> allowing Odresh to join as a non-autonomous town.</p><ul><li>Signed 28th August 2019</li></ul><h2 id="merger-with-vinland" tabindex="-1"><s>Merger with Vinland</s> <a class="header-anchor" href="#merger-with-vinland" aria-hidden="true">#</a></h2><p>Yoahtl signed the <a href="https://civstorage.github.io/yoahtl/vinland-ascension/" target="_blank" rel="noopener noreferrer">Merger with Vinland</a> treaty allowing Vinland to join as an autonomous town.</p><ul><li>Signed 28th September 2019</li><li>Voided 18th May 2020</li></ul><h2 id="condemning-obby-bombing" tabindex="-1">Condemning Obby Bombing <a class="header-anchor" href="#condemning-obby-bombing" aria-hidden="true">#</a></h2><p>Yoahtl signed the <a href="https://civstorage.github.io/yoahtl/condemning-obby-bombing/" target="_blank" rel="noopener noreferrer">International Resolution to Condemn Obsidian Bombing</a> treaty.</p><ul><li>Signed 7th December 2019</li></ul><h2 id="joining-the-udf" tabindex="-1">Joining the UDF <a class="header-anchor" href="#joining-the-udf" aria-hidden="true">#</a></h2><p>Yoahtl agreed to the terms of the <a href="https://civstorage.github.io/yoahtl/united-defense-front/" target="_blank" rel="noopener noreferrer">Charter of the United Defense Front</a>.</p><ul><li>Signed 28th February 2020</li></ul><h2 id="forum-for-international-diplomacy" tabindex="-1">Forum for International Diplomacy <a class="header-anchor" href="#forum-for-international-diplomacy" aria-hidden="true">#</a></h2><p>Yoahtl signed the <a href="https://civstorage.github.io/yoahtl/forum-for-international-diplomacy/" target="_blank" rel="noopener noreferrer">Charter of the Forum for International Diplomacy</a> treaty as a founding member.</p><ul><li>Signed 4th March 2020</li></ul><h2 id="treaty-of-terestai" tabindex="-1"><s>Treaty of Terestai</s> <a class="header-anchor" href="#treaty-of-terestai" aria-hidden="true">#</a></h2><p>Yoahtl signed the <a href="https://civstorage.github.io/yoahtl/ashelor-ascension/" target="_blank" rel="noopener noreferrer">Treaty of Terestai</a> allowing Ashelor to join as a non-autonomous town.</p><ul><li>Signed 7th August 2020</li><li>Voided 12th October 2020</li></ul>',30),n=[i];function h(s,l,d,f,u,g){return a(),t("div",null,n)}var p=e(o,[["render",h]]);export{b as __pageData,p as default};
